import React from 'react'

const Nav = () => {
  return (
    <navbar className="Nav">
        <a href="#introID">Introduction</a>
        <a href="#projectID">Projects</a>
        <a href="#contactID">Contact</a>
    </navbar>
  )
}

export default Nav;
